    for (n, A) in test_cases:
        s = [[], []]
        for si in A:
            s[si + 2].append(si)
        s[0].sort()
        s[1].sort()
        r = [[[0, 0], [0, 0]], [[0, 0], [0, 0]]]
        for ia in range(2):
            for ib in range(2):
                (a, b, c) = ([], [], [s[0][:], s[1][:]])
                (ap, bp) = (ia, ib)
                if len(c[ap]) > 0:
                    a.append(c[ap].pop())
                    ap ^= 1
                if len(c[bp]) > 0:
                    b.append(c[bp].pop())
                    bp ^= 1
                if len(a) > 0 or len(b) > 0:
                    while len(c[ap]) > 0 or len(c[bp]) > 0:
                        if len(c[ap]) > 0:
                            a.append(c[ap].pop())
                            ap ^= 1
                        if len(c[bp]) > 0:
                            b.append(c[bp].pop())
                            bp ^= 1
                (r[ia][ib][0], r[ia][ib][1]) = (sum(a), sum(b))
        ascore = [0, 0]
        for ap in range(2):
            d = r[ap][0][1] - r[ap][1][1]
            if d == 0:
                d = r[ap][0][0] - r[ap][1][0]
            bp = 0 if d > 0 else 1
            ascore[ap] = r[ap][bp][0]
        ans = max(ascore)
        results.append(ans)
    return results

